import React, {useContext} from 'react'
import { AuthContext } from '../../Context/auth'

const HomePage = () => {

  const { logout } = useContext(AuthContext);
  const handleLogout = () => {
    logout();
  }

  return (
    <div>
      <h1>HOME PAGE</h1>
      <button onClick={handleLogout}></button>
    </div>
  )
}

export default HomePage
